    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

      if (tileView.style.display === 'none') {
        // tileView is now hidden, go to current slide
        slideshow.gotoSlide(tileVars.currentSlideIdx + 1)

        // remove scroll/mousewheel event blocking
        tileView.removeEventListener('mousewheel', blockEvent)
        tileView.removeEventListener('DOMMouseScroll', blockEvent)
        console.log('removing blockScaling')
        document.removeEventListener('keydown', blockScaling)
      } else {
        // store current slide index prior to launching tile-view
        tileVars.currentSlideIdx = slideshow.getCurrentSlideIndex()

        // set class on seen and current slide and scroll into view
        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        // block remarkjs from handling scroll events
        tileView.addEventListener('mousewheel', blockEvent)
        tileView.addEventListener('DOMMouseScroll', blockEvent)
        console.log('adding blockScaling')
        document.addEventListener('keydown', blockScaling)
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}
    const blockEvent = ev => ev.stopPropagation()
    const blockScaling = function (ev) {
      if (ev.controlKey || ev.metaKey) {
        if (ev.key === '=' || ev.key === '-') {
          ev.preventDefault()
          console.log('window scaling is not allowed inside the tile overview')
        }
      }
    }

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

    <script>/* global slideshow,window,document */
window.xaringanExtraClipboard = function (selector, text) {
  if (!window.ClipboardJS.isSupported()) return
  if (!window.xaringanExtraClipboards) window.xaringanExtraClipboards = {}

  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const {
      button: buttonText = 'Copy Code',
      success: successText = 'Copied!',
      error: errorText = 'Press Ctrl+C to Copy'
    } = text

    const template = '<button class="xaringanextra-clipboard-button" ' +
       `type="button" aria-label="Copy code to clipboard">${buttonText}</button>`

    const isRemarkSlideshow = typeof slideshow !== 'undefined' &&
      Object.prototype.hasOwnProperty.call(slideshow, 'getSlides')

    let siblingSelector = selector || 'pre'
    if (!selector && isRemarkSlideshow) {
      siblingSelector = '.remark-slides-area ' + siblingSelector
    }

    // insert <button>s
    document.querySelectorAll(siblingSelector).forEach(el => {
      if ([/^$/, 'inherit', 'unset', 'revert', 'static'].some(p => el.style.position.match(p))) {
        el.style.position = 'relative'
      }
      el.insertAdjacentHTML('beforeend', template)

      // match button text color to code color
      const currentColor = window.getComputedStyle(el.children[0]).getPropertyValue('color')
      el.querySelector('button.xaringanextra-clipboard-button').style.color = currentColor
    })

    // initialize cliboardjs
    const clipboard = new window.ClipboardJS(siblingSelector + ' .xaringanextra-clipboard-button', {
      text: function (trigger) {
        // temporarily remove the button text
        // so that it isn't included in the text that's copied
        const btnLabel = trigger.innerHTML
        trigger.innerHTML = ''
        // snapshot text of copy button's parent element
        const text = trigger.parentElement.innerText
        // restore the button's inner HTML
        trigger.innerHTML = btnLabel
        return text
      }
    })

    // show success text for 2.5 seconds on success
    clipboard.on('success', function (ev) {
      ev.trigger.innerHTML = successText
      ev.trigger.style.display = 'block'
      setTimeout(function () {
        ev.trigger.innerHTML = buttonText
        ev.trigger.style.display = ''
      }, 2500)
      ev.clearSelection()
    })

    // show error text for 2.5 seconds on error
    clipboard.on('error', function (ev) {
      ev.trigger.innerHTML = errorText
      setTimeout(function () { ev.trigger.innerHTML = buttonText }, 2500)
    })

    // block remark click/touch slide change event listeners
    if (isRemarkSlideshow) {
      ['touchstart', 'touchend', 'touchmove'].forEach(function (evType) {
        document.querySelector('.remark-slides-area').addEventListener(evType, function (ev) {
          if (!ev.target.closest('pre')) return
          if (ev.target.closest('pre').querySelector('.xaringanextra-clipboard-button')) {
            ev.stopPropagation()
          }
        })
      })
    }

    window.xaringanExtraClipboards[siblingSelector] = clipboard
  })
}

## How we are going to do it?

We will make use of
- `sf`&#39;s excellent interface to straightforward manipulate the `geometry` column
- barebones `ggplot2` again
- most importantly, some mathematical voodoo for rotating the data, called affine transformation

---

## A lay persons&#39;s explanation of the mathematical background

Creating a 3D map comprises two steps

1. Shearing the geometries
2. Rotating the geometries

---

## Shearing

Shearing or shear mapping is a method of geometric data transformation which &#39;distorts&#39; the data while preserving the size of the area
- with a signed distance in reference
- to a fixed line or point

--

.pull-left[
From this...

]

--

]

## Rotation

In our example, rotation serves an aesthetic purpose: 
- the horizontal line should not be horizontal
- you don&#39;t need that necessarily

## Formula

So we not only multiply any point in our data with a shear matrix, which serves the shear transformation, but also a rotation matrix:

`$${[x,y]} \times \underbrace{\begin{bmatrix}2   &amp; 0  \\ 1.2 &amp; 1 \end{bmatrix}}_\text{Shear Matrix} \times \underbrace{\begin{bmatrix} \cos(\frac{\pi}{20}) &amp; \sin(\frac{\pi}{20}) \\ -\sin(\frac{\pi}{20}) &amp; \cos(\frac{\pi}{20})\end{bmatrix}}_\text{Rotation Matrix} \underbrace{(+ \begin{bmatrix}x\_add &amp; y\_add \end{bmatrix})}_\text{Optional Additions}$$`

At the end of this operation, we can also add an `\(x\)` or `\(y\)` offset value to move the whole thing in two-dimensional space. This creates this layer optic, as we&#39;ve seen in the beginning.

---

## R Implementation


```r
rotate_data &lt;- function(data, x_add = 0, y_add = 0) {
  
  shear_matrix &lt;- function () { 
    matrix(c(2, 1.2, 0, 1), 2, 2) 
  }
  
  rotate_matrix &lt;- function(x) { 
    matrix(c(cos(x), sin(x), -sin(x), cos(x)), 2, 2) 
  }
  
  data %&gt;% 
    dplyr::mutate(
      geometry = 
        .$geometry * shear_matrix() * rotate_matrix(pi/20) + c(x_add, y_add)
    )
}
```

---

## Let&#39;s start with a simple square

Using `sf`, we can create a basic rectangle more or less just like in a drawing program.

.pull-left[

```r
simple_square &lt;-
  sf::st_point(1:2) %&gt;% 
  sf::st_sfc() %&gt;%
  sf::st_sf() %&gt;% 
  sf::st_buffer(
    10, 
    endCapStyle = &quot;SQUARE&quot;
  )
```
]

--

.pull-right[

```r
ggplot() +
  geom_sf(data = simple_square)
```

]

## Application of our pre-defined function 

What is nice about the pre-defined function is that we can simply unleash it on our drawn rectangle

.pull-left[

```r
simple_square_rotated &lt;-
  simple_square %&gt;% 
  rotate_data()
```
]

--

.pull-right[

```r

  geom_sf(data = simple_square_rotated)

## Adding multiple layers

We can also recycle our rectangle and adding a `y` offset value.

.pull-left[

```r
ggplot() +
  geom_sf(
    data = 
      simple_square %&gt;% 
      rotate_data()
  ) +
  geom_sf(
    data = 
      simple_square %&gt;% 
      rotate_data(y_add = 15)
  )
```
]

## What&#39;s next?

You can do this rotation stuff with any geometry:
- points
- lines
- polygons

In the upcoming exercise, you will get used to apply the function by rotating multiple different geometries. But first, we are going to learn from one more geospatial technique as a prerequisite...

---

## Geocoding!

Our geometries should be centered around a specific point in space. In principle, we can use an arbitrary point in space. 

However, wouldn&#39;t it be nice to start from a place or address your familiar with? You can use geocoding to retrieve the place&#39;s point in space:
- conversion from an address to a geocoordinate
- there are multiple providers of such a service
  - we can use OpenstreetMap!
  
---

## Geocoding the GESIS Cologne Address


```r
gesis_cologne &lt;-
  tmaptools::geocode_OSM(
    &quot;Unter Sachsenhausen 6, 50667 Köln&quot;, 
    as.sf = TRUE,
    geometry = &quot;point&quot;
    ) %&gt;% 
  sf::st_transform(3035) %&gt;% 
  dplyr::select(query, geometry = point)

gesis_cologne
```

```

## Going crazy: Adding custom elements

Some additional packages for `ggplot2` already provide functionalities to add custom elements
- scale bars
- compasses

However, they are often small images added to the plot, which makes rotating them a bit hard.

**Thus, we just draw them ourselves as additional `sf` geometries.**

---

## Basic scale bar: prerequisites



First, let&#39;s use our `bboxing()` function from the previous exercise:


```r
gesis_bbox &lt;- bboxing(gesis_cologne)
```

It&#39;s the frame we are orientating on for &#39;drawing&#39;. Just like your canvas in MS paint...

---

## Basic scale bar: the whole thing

Scalebars have a specific length. We define it here by restructuring our pre-defined frame.

.pull-left[

```r
gesis_cologne_scalebar &lt;- 
  (gesis_bbox + c(1000, 0, 0, -1950)) %&gt;% 
  sf::st_as_sfc() %&gt;%
  sf::st_sf()
```
]

--

.pull-right[

```r
plot(gesis_cologne_scalebar)
```

&lt;img src=&quot;data:image/png;base64,#2_4_Advanced_Maps_II_files/figure-html/scalebar-frame-plot-1.png&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

---

## Basic scale bar: sections

Often scalebars include sections for measuring distances. That&#39;s something we can also draw and add to our scalebar.

.pull-left[

```r
gesis_cologne_scalebar &lt;-
  rbind(
    gesis_cologne_scalebar %&gt;% 
      {sf::st_bbox(.) + c(750, 0, 0, 0)} %&gt;% 
      sf::st_as_sfc() %&gt;%
      sf::st_sf(),
    gesis_cologne_scalebar %&gt;% 
      {sf::st_bbox(.) + c(500, 0, -250, 0)} %&gt;% 
      sf::st_as_sfc() %&gt;%
      sf::st_sf(),
    gesis_cologne_scalebar %&gt;% 
      {sf::st_bbox(.) + c(250, 0, -500, 0)} %&gt;% 
      sf::st_as_sfc() %&gt;%
      sf::st_sf(),
    gesis_cologne_scalebar %&gt;% 
      {sf::st_bbox(.) + c(0, 0, -750, 0)} %&gt;%
      sf::st_as_sfc() %&gt;%
      sf::st_sf()
  )
```
]

--

.pull-right[

```r
plot(gesis_cologne_scalebar)
```

]

Let&#39;s have a look at our map inluding our custom scalebar.



.pull-left[

```r
ggplot() +
  geom_sf(data = gesis_roads) +
  geom_sf(
    data = gesis_cologne_scalebar,
    color = &quot;black&quot;,
    fill = rep(c(&quot;black&quot;, &quot;white&quot;), 2)
  ) +

```

## Rotated map with a scalebar

And now let&#39;s see how it perform when roating the whole map.

.pull-left[

```r
ggplot() +
  geom_sf(
    data = 
      gesis_roads %&gt;% 
      rotate_data()
  ) +
  geom_sf(
    data = 
      gesis_cologne_scalebar %&gt;% 
      rotate_data(x_add = -150, y_add = -100),
    color = &quot;black&quot;,
    fill = rep(c(&quot;black&quot;, &quot;white&quot;), 2)
  ) +
  
  annotate(&quot;text&quot;, 
           x = gesis_cologne_scalebar %&gt;% 
             rotate_data(x_add = -150, y_add = -100) %&gt;% 
             sf::st_bbox() %&gt;% 
             .$xmin, 
           y = gesis_cologne_scalebar %&gt;% 
             rotate_data(x_add = -150, y_add = -100) %&gt;% 
             sf::st_bbox() %&gt;% 
             .$ymax - 150,
           label = &quot;0 km&quot;,
           angle = -12,
           size = 3
  ) +
  annotate(&quot;text&quot;, 
           x = gesis_cologne_scalebar %&gt;% 
             rotate_data(x_add = -150, y_add = -100) %&gt;% 
             sf::st_bbox() %&gt;% 
             .$xmax - 200, 
           y = gesis_cologne_scalebar %&gt;% 
             rotate_data(x_add = -150, y_add = -100) %&gt;% 
             sf::st_bbox() %&gt;% 
             .$ymin - 130,
           label = &quot;1 km&quot;,
           angle = -12,
           size = 3
  ) +
  ggsn::blank()
```
